import React from 'react';
import css from './Post.module.css'

const Post = (props) => {
    return (
    <li className={css.item}>
      <div className={css.avatar}>
        <img alt="postImg" src="" />
      </div>

      <div>
        <p>{props.message}</p>
      </div>
    </li>
    )
}

export default Post;
